import React, { useState, useEffect } from 'react';
import { 
  Typography, 
  Grid, 
  Paper, 
  Card, 
  CardContent, 
  CardHeader,
  Button,
  Box,
  CircularProgress,
  Divider
} from '@mui/material';
import { Link as RouterLink } from 'react-router-dom';
import AssessmentIcon from '@mui/icons-material/Assessment';
import FolderOpenIcon from '@mui/icons-material/FolderOpen';
import WarningIcon from '@mui/icons-material/Warning';
import UpdateIcon from '@mui/icons-material/Update';
import ArrowForwardIcon from '@mui/icons-material/ArrowForward';
import api from '../services/api';

// Sample chart component (to be replaced with an actual chart library)
const SampleChart = ({ type }) => {
  return (
    <Box
      sx={{
        height: 200,
        bgcolor: 'rgba(33, 150, 243, 0.1)',
        borderRadius: 1,
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
      }}
    >
      <Typography color="text.secondary">
        {type} Chart Visualization
      </Typography>
    </Box>
  );
};

const Dashboard = () => {
  const [loading, setLoading] = useState(true);
  const [stats, setStats] = useState({
    totalProjects: 0,
    recentAnalyses: [],
    totalDependencies: 0,
    outdatedDependencies: 0,
    vulnerabilities: 0,
  });

  useEffect(() => {
    // Simulated data loading
    // In a real app, you would fetch this data from your API
    setTimeout(() => {
      setStats({
        totalProjects: 5,
        recentAnalyses: [
          { id: 1, projectId: 1, projectName: 'Spring Boot API', date: '2023-07-20', dependencies: 35, outdated: 12 },
          { id: 2, projectId: 2, projectName: 'Web Client', date: '2023-07-18', dependencies: 48, outdated: 15 },
          { id: 3, projectId: 3, projectName: 'Utility Library', date: '2023-07-15', dependencies: 22, outdated: 5 },
        ],
        totalDependencies: 105,
        outdatedDependencies: 32,
        vulnerabilities: 8,
      });
      setLoading(false);
    }, 1000);
  }, []);

  if (loading) {
    return (
      <Box sx={{ display: 'flex', justifyContent: 'center', mt: 10 }}>
        <CircularProgress />
      </Box>
    );
  }

  return (
    <>
      <Typography variant="h4" component="h1" gutterBottom>
        Dashboard
      </Typography>

      {/* Summary Cards */}
      <Grid container spacing={3} sx={{ mb: 4 }}>
        <Grid item xs={12} sm={6} md={3}>
          <Paper
            elevation={0}
            sx={{
              p: 2,
              display: 'flex',
              flexDirection: 'column',
              bgcolor: 'rgba(33, 150, 243, 0.1)',
              borderRadius: 2,
            }}
          >
            <Box sx={{ display: 'flex', alignItems: 'center' }}>
              <Box
                sx={{
                  display: 'flex',
                  alignItems: 'center',
                  justifyContent: 'center',
                  bgcolor: 'primary.main',
                  color: 'white',
                  width: 40,
                  height: 40,
                  borderRadius: '50%',
                  mr: 2,
                }}
              >
                <FolderOpenIcon />
              </Box>
              <Typography variant="h5">{stats.totalProjects}</Typography>
            </Box>
            <Typography color="text.secondary" sx={{ mt: 1 }}>
              Projects
            </Typography>
          </Paper>
        </Grid>

        <Grid item xs={12} sm={6} md={3}>
          <Paper
            elevation={0}
            sx={{
              p: 2,
              display: 'flex',
              flexDirection: 'column',
              bgcolor: 'rgba(76, 175, 80, 0.1)',
              borderRadius: 2,
            }}
          >
            <Box sx={{ display: 'flex', alignItems: 'center' }}>
              <Box
                sx={{
                  display: 'flex',
                  alignItems: 'center',
                  justifyContent: 'center',
                  bgcolor: '#4caf50',
                  color: 'white',
                  width: 40,
                  height: 40,
                  borderRadius: '50%',
                  mr: 2,
                }}
              >
                <AssessmentIcon />
              </Box>
              <Typography variant="h5">{stats.totalDependencies}</Typography>
            </Box>
            <Typography color="text.secondary" sx={{ mt: 1 }}>
              Total Dependencies
            </Typography>
          </Paper>
        </Grid>

        <Grid item xs={12} sm={6} md={3}>
          <Paper
            elevation={0}
            sx={{
              p: 2,
              display: 'flex',
              flexDirection: 'column',
              bgcolor: 'rgba(255, 152, 0, 0.1)',
              borderRadius: 2,
            }}
          >
            <Box sx={{ display: 'flex', alignItems: 'center' }}>
              <Box
                sx={{
                  display: 'flex',
                  alignItems: 'center',
                  justifyContent: 'center',
                  bgcolor: '#ff9800',
                  color: 'white',
                  width: 40,
                  height: 40,
                  borderRadius: '50%',
                  mr: 2,
                }}
              >
                <UpdateIcon />
              </Box>
              <Typography variant="h5">{stats.outdatedDependencies}</Typography>
            </Box>
            <Typography color="text.secondary" sx={{ mt: 1 }}>
              Outdated Dependencies
            </Typography>
          </Paper>
        </Grid>

        <Grid item xs={12} sm={6} md={3}>
          <Paper
            elevation={0}
            sx={{
              p: 2,
              display: 'flex',
              flexDirection: 'column',
              bgcolor: 'rgba(244, 67, 54, 0.1)',
              borderRadius: 2,
            }}
          >
            <Box sx={{ display: 'flex', alignItems: 'center' }}>
              <Box
                sx={{
                  display: 'flex',
                  alignItems: 'center',
                  justifyContent: 'center',
                  bgcolor: '#f44336',
                  color: 'white',
                  width: 40,
                  height: 40,
                  borderRadius: '50%',
                  mr: 2,
                }}
              >
                <WarningIcon />
              </Box>
              <Typography variant="h5">{stats.vulnerabilities}</Typography>
            </Box>
            <Typography color="text.secondary" sx={{ mt: 1 }}>
              Vulnerabilities
            </Typography>
          </Paper>
        </Grid>
      </Grid>

      <Grid container spacing={3}>
        {/* Recent Analyses */}
        <Grid item xs={12} md={6}>
          <Card>
            <CardHeader 
              title="Recent Analyses" 
              action={
                <Button 
                  component={RouterLink} 
                  to="/analysis-history" 
                  size="small" 
                  endIcon={<ArrowForwardIcon />}
                >
                  View All
                </Button>
              }
            />
            <Divider />
            <CardContent>
              {stats.recentAnalyses.length > 0 ? (
                stats.recentAnalyses.map((analysis) => (
                  <Box key={analysis.id} sx={{ mb: 2 }}>
                    <Grid container spacing={2}>
                      <Grid item xs={8}>
                        <Typography variant="subtitle1" component={RouterLink} to={`/analysis/${analysis.id}`} sx={{ textDecoration: 'none', color: 'primary.main' }}>
                          {analysis.projectName}
                        </Typography>
                        <Typography variant="body2" color="text.secondary">
                          Analyzed on {analysis.date}
                        </Typography>
                      </Grid>
                      <Grid item xs={4} sx={{ textAlign: 'right' }}>
                        <Typography variant="body2">
                          {analysis.dependencies} dependencies
                        </Typography>
                        <Typography variant="body2" color="warning.main">
                          {analysis.outdated} outdated
                        </Typography>
                      </Grid>
                    </Grid>
                    <Divider sx={{ mt: 2 }} />
                  </Box>
                ))
              ) : (
                <Typography>No recent analyses found</Typography>
              )}
            </CardContent>
          </Card>
        </Grid>

        {/* Charts */}
        <Grid item xs={12} md={6}>
          <Card>
            <CardHeader 
              title="Dependency Overview" 
              action={
                <Button 
                  component={RouterLink} 
                  to="/charts" 
                  size="small" 
                  endIcon={<ArrowForwardIcon />}
                >
                  View Charts
                </Button>
              }
            />
            <Divider />
            <CardContent>
              <SampleChart type="Dependency Overview" />
            </CardContent>
          </Card>
        </Grid>
      </Grid>

      {/* Quick Actions */}
      <Box sx={{ mt: 4 }}>
        <Typography variant="h6" gutterBottom>
          Quick Actions
        </Typography>
        <Grid container spacing={2}>
          <Grid item>
            <Button 
              variant="contained" 
              component={RouterLink} 
              to="/projects"
              state={{ openNewProjectDialog: true }}
            >
              Create New Project
            </Button>
          </Grid>
          <Grid item>
            <Button 
              variant="outlined" 
              component={RouterLink} 
              to="/projects"
            >
              View All Projects
            </Button>
          </Grid>
          <Grid item>
            <Button 
              variant="outlined" 
              component={RouterLink} 
              to="/analysis-history"
            >
              View Analysis History
            </Button>
          </Grid>
        </Grid>
      </Box>
    </>
  );
};

export default Dashboard;
